INSERT INTO `tabel_berita` VALUES (1,'Peluncuran Sistem Informasi Praktek Kerja Industri','peluncuran-sistem-informasi-praktek-kerja-industri','<p><strong>PRAKERIN Politeknik Negeri Tanah Laut -</strong>&nbsp;Segera meluncurkan sebuah sistem informasi yang&nbsp; Praktek Kerja Industri diantaranya yaitu:</p>\r\n\r\n<ol style=\"list-style-type:decimal; margin-left:20px; margin-right:20\">\r\n	<li>Sistem Informasi Managemen Praktek Kerja Industri (SIM-Prakerin)</li>\r\n	<li>Sistem Informasi Geografis Tempat Praktek Kerja Industri (SIG-Prakerin)</li>\r\n	<li>Sistem Informasi Monitoring Praktek Kerja Industri (SIMONEP)</li>\r\n</ol>\r\n','2019-07-30','1564474361Peluncuran_Sistem_Informasi_Praktek_Kerja_Industri.jpg',0,'');
