INSERT INTO `tabel_halaman` VALUES (1,'2019-07-18','Syarat Mahasiswa Bisa Melaksanakan Prakerin','syarat-mahasiswa-bisa-melaksanakan-prakerin',4,'<p>Peserta program Prakerin&nbsp;adalah mahasiswa aktif yang terdaftar pada Politenik Negeri Tanah Laut pada masa program ini berlangsung, dengan ketentuan mahasiswa harus memenuhi persyaratan dengan menyerahkan berkas sebagai berikut:</p>\r\n\r\n<ol style=\"list-style-type:decimal; margin-left:20px;\">\r\n	<li>Terdaftar sebagai mahasiswa dalam tahun akademik semester berjalan.</li>\r\n	<li>Indek Prestasi Kumulatif minimal 2,5 (dua koma lima)</li>\r\n	<li>Nilai D maksimal 5 (Lima) SKS tanpa ada nilai E dari semester 1-3.</li>\r\n	<li>Mengajukan proposal Prakerin&nbsp;yang telah disetujui Dosen pembimbing dan Ketua Jurusan masing-masing ke panitia Prakerin&nbsp;di jurusan masing-masing.</li>\r\n</ol>\r\n');
INSERT INTO `tabel_halaman` VALUES (2,'2019-07-18','Tata Tertib Pelaksanaan Prakerin','tata-tertib-pelaksanaan-prakerin',4,'<p><strong>Kriteria perusahaan</strong></p>\r\n\r\n<ol style=\"list-style-type:decimal; margin-left:20px\">\r\n	<li>Perusahaan/Instansi/Lembaga yang berbadan Hukum.</li>\r\n	<li>Bersedia menugaskan 1 orang pembimbing dari perusahaan selama pelaksanaan Prakerin.</li>\r\n	<li>Menyediakan waktu selama 4 bulan untuk pelaksanaan Prakerin.</li>\r\n	<li>Pada kasus perusahaan yang tidak dapat memberikan waktu Prakerin&nbsp;selama 4 bulan, maka mahasiswa yang bersangkutan diwajibkan mencari tempat Prakerin&nbsp;di instansi atau perusahaan lain untuk memenuhi waktu Prakerin&nbsp;yang telah ditentukan.</li>\r\n</ol>\r\n\r\n<p><strong>Tata Tertib di Kampus</strong></p>\r\n\r\n<ol style=\"list-style-type:decimal; margin-left:20px\">\r\n	<li>Menyelesaikan semua administrasi sebelum berangkat Prakerin&nbsp;</li>\r\n	<li>Menyelesaikan semua administrasi untuk pelaksanaan seminar Prakerin&nbsp;di kampus</li>\r\n	<li>Melaksanakan pendaftaran seminar Prakerin&nbsp;maksimal 1 minggu setelah tanggal akhir jadwal pelaksanaan Prakerin</li>\r\n	<li>Apabila nilai akhir di bawah C, maka mahasiswa ybs dinyatakan tidak lulus dan harus mengulang di periode berikutnya.</li>\r\n	<li>Apabila tidak mematuhi tata tertib dan aturan yang berlaku, maka mahasiswa ybs dinyatakan tidak lulus dan harus mengulang di periode berikutnya</li>\r\n</ol>\r\n\r\n<p><strong>Tata Tertib di Tempat Prakerin</strong></p>\r\n\r\n<ol style=\"list-style-type:decimal; margin-left:20px\">\r\n	<li>Mematuhi peraturan dan tata tertib yang berlaku di tempat Praktek Kerja Industri.</li>\r\n	<li>Memberitahukan kepada pimpinan atau pembimbing apabila berhalangan hadir.</li>\r\n	<li>Mengkomunikasikan dengan pembimbing lapangan apabila menemui kesulitan atau masalah tertentu yang dihadapi.</li>\r\n	<li>Mampu menjaga kerahasiaan perusahaan.</li>\r\n	<li>Memberikan surat pernyataan bahwa mahasiswa yang bersangkutan diterima Prakerin&nbsp;(Format masing-masing Instansi/Perusahaan)</li>\r\n</ol>\r\n');
INSERT INTO `tabel_halaman` VALUES (3,'2019-07-23','Tugas Unit Layanan Praktek Kerja Industri','tugas-unit-layanan-praktek-kerja-industri',3,'<p>Berikut ini adalah tugas unit layanan praktek kerja industri dalampelaksanaan proses pelaksanaan Prakerin&nbsp;mahasiswa:&nbsp;</p>\r\n\r\n<ol style=\"list-style-type:decimal; margin-left:20px; margin-right:20\">\r\n	<li>Memberikan daftar nama-namaperusahaan.</li>\r\n	<li>Membuatkan surat keputusan (SK) penetapan dosen pembimbing Prakerin.</li>\r\n	<li>Membuat daftar mahasiswa, lokasi/tujuan Prakerin, tanggal mulai aktif pelaksanaan Prakerin&nbsp;dan tanggal akhir pelaksanaan Prakerin.</li>\r\n	<li>Membuatkan surat pengantar dan surat tugasuntuk mahasiswa Prakerin.</li>\r\n	<li>Menyiapkan dan membuatkan surat menyurat yang berkaitan dengan pelaksanaan Prakerin.</li>\r\n	<li>Mensosialisasikan standar operasional prosedur (SOP) kegiatan Prakerin.</li>\r\n</ol>\r\n');
INSERT INTO `tabel_halaman` VALUES (4,'2019-07-30','Pelaksanaan Prakerin 2019-2020','pelaksanaan-prakerin-2019-2020',5,'<p>Waktu pelaksanaan Praktek Kerja Industri&nbsp;pada Politeknik Negeri Tanah Laut mulai dari <strong>16 September 2019 - 16 Januari 2020</strong></p>\r\n');
