INSERT INTO `tb_kuesioner_kriteria` VALUES (1,'KESESUAIAN JURUSAN  DAN CORE PERUSAHAAN','IML006');
INSERT INTO `tb_kuesioner_kriteria` VALUES (3,'KREDIBILITAS PERUSAHAAN','IML006');
INSERT INTO `tb_kuesioner_kriteria` VALUES (4,'KOMITMEN PERUSAHAAN','IML006');
INSERT INTO `tb_kuesioner_kriteria` VALUES (5,'LINGKUNGAN PERUSAHAAN','IML006');
INSERT INTO `tb_kuesioner_kriteria` VALUES (6,'FASILITAS PERUSAHAAN','IML006');
INSERT INTO `tb_kuesioner_pertanyaan` VALUES (1,'Apakah Perusahaan tempat anda PKL sudah sesuai dengan Jurusan Anda (dalam artian terdapat divisi untuk mendukung kompetensi anda dalam meningkatkan skill dan pengetahuan sesuai dengan jurusan anda)?\r\n',1);
INSERT INTO `tb_kuesioner_pertanyaan` VALUES (3,'Apakah perusahaan anda termasuk dalam perusahaan berskala: ',3);
INSERT INTO `tb_kuesioner_pertanyaan` VALUES (4,'Apakah perusahaan anda memiliki visi jelas (dilihat dari manajemen dan kinerja kariawan yang optimal setiap harinya) ?\r\n',3);
INSERT INTO `tb_kuesioner_pertanyaan` VALUES (5,'Apakah Perusahaan anda mendukung pengembangan karir kariawan disana (artinya; kariawan sangat diperhatikan)?\r\n',3);
INSERT INTO `tb_kuesioner_pertanyaan` VALUES (6,'Apakah Perusahaan anda mempunya manajemen yang bagus dan terkoordinasi dengan sangat baik?\r\n',3);
INSERT INTO `tb_kuesioner_pertanyaan` VALUES (7,'Apakah perusahaan anda sangat terbuka (dalam artian tidak menutup diri dengan lingkungan sekitar dalam segala proses produksinya) ?\r\n',3);
INSERT INTO `tb_kuesioner_pertanyaan` VALUES (8,'Apakah Perusahaan anda mendukung program PKL/peduli dengan pendidikan? \r\n',4);
INSERT INTO `tb_kuesioner_pertanyaan` VALUES (9,'Apakah anda di bimbing secara intesif selama menjalani PKL disana?\r\n',4);
INSERT INTO `tb_kuesioner_pertanyaan` VALUES (10,'Apakah perusahaan mempunyai program khusus bagi mahasiswa PKL (seperti: jadwal-jadwal setiap bulan mahaiswa harus bisa apa, buka hanya mengalir saja)?\r\n',4);
INSERT INTO `tb_kuesioner_pertanyaan` VALUES (11,'Apakah anda selalu diajarkan/dilibatkan dalam suatu project/pekerjaan (walau hanya sebagai pengamat karena mungkin anda masih anak PKL) ?\r\n',4);
INSERT INTO `tb_kuesioner_pertanyaan` VALUES (12,'Apakah lingkungan anda di perusahaan mendukung dalam peningkatan skill, etika dan pengetahuan kalian terhadap kompetensi yang akan dicapai?\r\n',5);
INSERT INTO `tb_kuesioner_pertanyaan` VALUES (13,'Apakah manajemen/kariawan sangat ramah (tidak saling bermusuhan), sehingga mempermudah anda dalam bersosialisai dan berkomunikasi?\r\n',5);
INSERT INTO `tb_kuesioner_pertanyaan` VALUES (14,'Apakah perusahaan sangat peduli dengan K3 (keselamatan kerja) baik karaywan, lingkungan (baik masyarakat maupun terhadap pencemaran)?\r\n',5);
INSERT INTO `tb_kuesioner_pertanyaan` VALUES (15,'Apakah perusahaan tempat anda menyediakan fasilitas ? (lihat ketentuan diatas)\r\n',6);
INSERT INTO `tb_kuesioner_pertanyaan` VALUES (16,'Apakah Perusahaan tempat PKL anda menawarkan /terbuka/ memberikan peluang kepada anda sebagai mahasiswa PKL untuk berkarir/ bekerja jika nanti anda sudah lulus?\r\n',6);
